import React, { useContext } from 'react';
import StarWarContext from '../context/StarWarContext';
// import { requestAPIAxios, requestAPI } from '../service/requestAPI';

function Table() {
  const { data } = useContext(StarWarContext);

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Rotation Period</th>
          <th>Orbital Period</th>
          <th>Diameter</th>
          <th>Climate</th>
          <th>Gravity</th>
          <th>Terrain</th>
          <th>Surface Water</th>
          <th>Population</th>
          <th>Films</th>
          <th>Created</th>
          <th>Edited</th>
          <th>URL</th>
        </tr>
      </thead>
      <tbody>
        {
          data.map((qq) => (
            <tr key={ qq.name }>
              <td>{ qq.name }</td>
              <td>{ qq.rotation_period }</td>
              <td>{ qq.orbital_period }</td>
              <td>{ qq.diameter }</td>
              <td>{ qq.climate }</td>
              <td>{ qq.gravity }</td>
              <td>{ qq.terrain }</td>
              <td>{ qq.surface_water }</td>
              <td>{ qq.population }</td>
              <td>
                  {item.films
                    .map((film, index) => <p key={ `${film}-${index}` }>{film}</p>)}
                </td>
              <td>{ qq.created }</td>
            </tr>
          ))
        }
      </tbody>
    </table>
  );
}

export default Table;
